import React, { useState, useCallback } from "react";
import Gallery from "react-photo-gallery";
import Carousel, { Modal, ModalGateway } from "react-images";
import DocumentMeta from "react-document-meta";

function PhotoGallery() {

	const [currentImage, setCurrentImage] = useState(0);
  const [viewerIsOpen, setViewerIsOpen] = useState(false);

  const openLightbox = useCallback((event, { photo, index }) => {
    setCurrentImage(index);
    setViewerIsOpen(true);
  }, []);

  const closeLightbox = () => {
    setCurrentImage(0);
    setViewerIsOpen(false);
	};
	
	const photos = [
		{
			src: "https://source.unsplash.com/2ShvY8Lf6l0/800x599",
			width: 4,
			height: 3
		},
		{
			src: "https://source.unsplash.com/Dm-qxdynoEc/800x799",
			width: 1,
			height: 1
		},
		{
			src: "https://source.unsplash.com/qDkso9nvCg0/600x799",
			width: 3,
			height: 4
		},
		{
			src: "https://source.unsplash.com/iecJiKe_RNg/600x799",
			width: 3,
			height: 4
		},
		{
			src: "https://source.unsplash.com/epcsn8Ed8kY/600x799",
			width: 3,
			height: 4
		},
		{
			src: "https://source.unsplash.com/NQSWvyVRIJk/800x599",
			width: 4,
			height: 3
		},
		{
			src: "https://source.unsplash.com/zh7GEuORbUw/600x799",
			width: 3,
			height: 4
		},
		{
			src: "https://source.unsplash.com/PpOHJezOalU/800x599",
			width: 4,
			height: 3
		},
		{
			src: "https://source.unsplash.com/I1ASdgphUH4/800x599",
			width: 4,
			height: 3
		}
	];

	const meta = {
    title: "How do I choose an Indian Nursing Recruitment Agency for Abroad?",
    description: "Destinex an Indian Nursing Recruitment Agency for Abroad. A recruitment agency gives proper guidance through the recruitment process till you get the nursing job at the best place.",
    canonical: "https://www.mbbsadmissionsinabroad.com/how-do-choose-an-indian-nursing-recruitment-agency-for-abroad",
    meta: {
      charset: "utf-8",
      name: {
        keywords: "How do I choose an Indian Nursing Recruitment Agency for Abroad",
      },
    },
	};

  return (
		<DocumentMeta {...meta}>
		<div>
			<div className="service__bg">
				<h1 className="service__title">Gallery</h1>
			</div>
      <Gallery photos={photos} onClick={openLightbox} />
      <ModalGateway>
        {viewerIsOpen ? (
          <Modal onClose={closeLightbox}>
            <Carousel
              currentIndex={currentImage}
              views={photos.map(x => ({
                ...x,
                srcset: x.srcSet,
                caption: x.title
              }))}
            />
          </Modal>
        ) : null}
      </ModalGateway>
		</div>
		</DocumentMeta>
  );
}

export default PhotoGallery;
